import React from "react";
import "../css/header.css";
import logo from "../brainster_space_logo.svg";
const Header = () => {
  return (
    <div className="header">
      <div className="logo">
        <img src={logo}></img>
      </div>
      <div>
        <ul>
          <li>SPACE БЛОГ</li>
          <li>НАСТАНИ</li>
          <li>CO-WORKING</li>
          <li>АКАДЕМИИ</li>
          <li>ПРОСТОР ЗА НАСТАНИ</li>
          <li>ПАРТНЕРСТВА</li>
        </ul>
      </div>
      <div>
        <ul>
          <li className="prikluci">ПРИКЛУЧИ СЕ</li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
